This is a relabeled and repackaged [[Netgear PLW1000]] with Geek Squad :branding exclusively for Best Buy. It is intended for use with the :[[Netgear R7300DST]] to add an additional access point.
The device uses a [[Broadcom]] BCM60335 as the HomePlug controller.
